import './App.css';
import { graphql_server } from './constants.js';

import {
  BrowserRouter as Router,
  Route,
  Link
} from 'react-router-dom'

import DetailPatient from './DetailPatient.js'

import React from 'react';
import ApolloClient from 'apollo-boost';
import { ApolloProvider } from '@apollo/client';

import {PatientInfo, CreatePatient} from './Patient.js';

const client = new ApolloClient({
  uri: graphql_server, 
});

const App = () => {
  render() ;{ 
    return ( <Router>
    <ApolloProvider client={client}>
      <div className={"container"} style={{marginTop:'5%', marginBottom:'10%'}}>
        <h2>Patient List</h2>

        < CreatePatient />
        < PatientInfo />

        < Route path="/patient/:id" component={DetailPatient} />

      </div>

    </ApolloProvider>
  </Router>
  )};
};

export default App;
